-- ----------------------------
--  Table structure for `event`
-- ----------------------------
DROP TABLE IF EXISTS `event`;
CREATE TABLE `event` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '接收事件',
  `serve_id` int(10) DEFAULT '0',
  `status` tinyint(1) DEFAULT '0' COMMENT '事件状态  1=正常通行  2=异常  3=一键通行（人工触发）  4=一键锁止（人工触发）',
  `time` int(10) DEFAULT '0' COMMENT '事件发生时间',
  `face` tinyint(1) DEFAULT '0' COMMENT '人脸数量',
  `people` tinyint(1) DEFAULT '0' COMMENT '行人数量',
  `result` char(16) DEFAULT '' COMMENT '识别结果',
  `add_time` int(10) DEFAULT '0' COMMENT '记录插入时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=399 DEFAULT CHARSET=utf8;

