-- ----------------------------
--  Table structure for `face`
-- ----------------------------
DROP TABLE IF EXISTS `face`;
CREATE TABLE `face` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '人脸信息',
  `name` char(32) DEFAULT '' COMMENT '姓名',
  `type_id` int(10) DEFAULT '0' COMMENT '人员类别  face_type.id',
  `status` tinyint(1) DEFAULT '0' COMMENT '进出状态  1=允许进出  2=不允许进出',
  `photo_number` tinyint(1) DEFAULT '0' COMMENT '照片数量',
  `number` char(32) DEFAULT '' COMMENT '人员唯一编号   会根据  type 字段值的不同，使用不同编号格式    除在押人员以外，均使用身份证号',
